tinymce.PluginManager.add("crowdfunding_button",function(t,n){t.addButton("crowdfunding_button",{text:"CF Shortcode",icon:!1,type:"menubutton",menu:[{text:"Registration",onclick:function(){t.insertContent("[wpcf_registration]")}},{text:"Dashboard",onclick:function(){t.insertContent("[wpcf_dashboard]")}},{text:"Search",onclick:function(){t.insertContent("[wpcf_search]")}},{text:"Form Shortcode",onclick:function(){t.insertContent("[wpcf_form]")}},{text:"Listing",onclick:function(){t.windowManager.open({title:"Campaign Listing Shortcode",body:[{type:"textbox",name:"number",label:"number",value:"-1"},{type:"textbox",name:"cat",label:"Category Slug",value:""}],onsubmit:function(n){t.insertContent('[wpcf_listing number="'+n.data.number+'" cat="'+n.data.cat+'" ]')}})}},{text:"Single Campaign Page",onclick:function(){t.windowManager.open({title:"Campaign Single Shortcode",body:[{type:"textbox",name:"campaign_id",label:"Campaign ID",value:"0"}],onsubmit:function(n){t.insertContent('[wpcf_single_campaign campaign_id="'+n.data.campaign_id+'" ]')}})}},{text:"Single Campaign Box",onclick:function(){t.windowManager.open({title:"Single Campaign Box Shortcode",body:[{type:"textbox",name:"campaign_id",label:"Campaign ID",value:"0"}],onsubmit:function(n){t.insertContent('[wpcf_campaign_box campaign_id="'+n.data.campaign_id+'" ]')}})}},{text:"Popular Campaigns",onclick:function(){t.windowManager.open({title:"Single Campaign Box Shortcode",body:[{type:"textbox",name:"limit",label:"Limit",value:"4"},{type:"textbox",name:"column",label:"Column",value:"4"},{type:"listbox",name:"order",label:"Order :",onselect:function(t){},values:[{text:"DESC",value:"DESC"},{text:"ASC",value:"ASC"}]},{type:"textbox",name:"class",label:"Class",value:"",tooltip:"Multiple classes should be separate by comma (,)"}],onsubmit:function(n){t.insertContent('[wpcf_popular_campaigns limit="'+n.data.limit+'" column="'+n.data.column+'" order="'+n.data.order+'" class="'+n.data.class+'" ]')}})}},{text:"Donate Button",onclick:function(){t.windowManager.open({title:"Campaign Donate Shortcode from Anywhere",body:[{type:"textbox",name:"campaign_id",label:"Campaign ID",value:""},{type:"textbox",name:"amount",label:"Amount",value:""},{type:"textbox",name:"min_amount",label:"Min Amount",value:""},{type:"textbox",name:"max_amount",label:"Max Amount",value:""},{type:"listbox",name:"show_input_box",label:"Show Input Box :",onselect:function(t){},values:[{text:"Yes",value:"true"},{text:"No",value:"false"}]},{type:"textbox",name:"donate_button_text",label:"Donate Button Text",value:"Donate Now"}],onsubmit:function(n){t.insertContent('[wpcf_donate campaign_id="'+n.data.campaign_id+'" amount="'+n.data.amount+'" min_amount="'+n.data.min_amount+'" max_amount="'+n.data.max_amount+'" show_input_box="'+n.data.show_input_box+'" donate_button_text="'+n.data.donate_button_text+'" ]')}})}}]})});